import React from 'react';
import Skill_1 from './images/html.jpg';
import Skill_2 from './images/css.jpg';
import Skill_3 from './images/js.jpg';

function ProgressBar() {
  const progressBarStyles = {
    maxWidth: '500px',
    height: '12px',
    backgroundColor: '#f1f1f1',
    borderRadius: '6px',
    margin: '10px auto',
    position: 'relative',
  };

  const progressFillStyles = {
    height: '100%',
    backgroundColor: '#4CAF50',
    borderRadius: '6px',
    position: 'absolute',
    top: '0',
    left: '0',
  };

  const progressLabelStyles = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    color: '#333',
    fontSize: '16px',
    fontWeight: 'bold',
    textTransform: 'uppercase',
  };

  return (
    <section id="skills" style={{ display: "flex", alignItems: "center", flexDirection: "column", color: 'black' }}>
      <h1 style={{ color: '#000000' }}>Skills</h1>
      <div>
      <img src={Skill_1} alt="Skill 1" style={{ margin: '10px', width: '30%' }}/>
      </div>
      <div>
      <img src={Skill_2} alt="Skill 2" style={{ margin: '10px', width: '30%' }}/>
      </div>
      <div>
      <img src={Skill_3} alt="Skill 3" style={{ margin: '10px', width: '30%' }}/>
      </div>
    </section>
    
  );
}

export default ProgressBar;
